import {Directive, ElementRef, EventEmitter, Input, Output, ViewContainerRef} from "@angular/core";
import { gsap, TimelineMax } from "gsap";

@Directive({
  selector: "[coreAnimation]"
})
export class CoreAnimationDirective{
  @Input() duration = 1;
  @Input() delay = 0;

  /**
   * event emitter for the animation complete callback
   */
  @Output() complete: EventEmitter<null> = new EventEmitter();
  /**
   * event emitter for the animation reverseComplete callback
   */
  @Output() reverseComplete: EventEmitter<null> = new EventEmitter();
  protected timeline: TimelineMax;


  constructor(protected el: ElementRef) {
    /** Handle animate-out event
     * animate-out event handler - handle the event on HTML element and call the method animateOut
     */
    this.el.nativeElement.addEventListener(
      'animate-out',
      ({detail}: {detail: any}) => {
        this.animateOut(detail.parentViewRef);
      }
    );

    // Config timeline
    this.timeline = new gsap.core.Timeline({
      //repeat: -1,
      onComplete: () => this.complete.emit(),
      onReverseComplete: () => this.reverseComplete.emit(),
      paused: true,
      reversed: true
    });
  }

  protected animateIn(){
    if(this.timeline.isActive()){
      this.timeline.kill();
    }

    this.timeline.play();
  }

  /**
   * this method play the animation of the directive, but reversed.
   * It kills the timeline if is running, and set a timeout to clear the parentViewRef,
   * according to the animation duration and delay.
   * @param parentViewRef
   * @protected
   */
  protected animateOut(parentViewRef: ViewContainerRef){
    if(this.timeline.isActive()){
      this.timeline.kill();
    }

    setTimeout(() => {
      this.timeline.timeScale(this.duration).delay(0).reverse();
      setTimeout(() => {
        if(parentViewRef){
          parentViewRef.clear();
        }
      }, this.duration * 1000);
    }, this.delay * 1000);
  }

}

import {
  Directive,
  OnInit,
  OnDestroy,
  ViewContainerRef,
  ElementRef,
  Input,
  Output,
  EventEmitter
} from "@angular/core";
import { gsap } from "gsap";
import { CoreAnimationDirective } from "./core-animation.directive";

@Directive({
  selector: "[fadeInAnimation]"
})
export class FadeInDirective extends CoreAnimationDirective implements OnInit{

  constructor(
    protected override el: ElementRef
  ) {
    super(el);
  }

  ngOnInit() {
    this.animateIn();
  }

  protected override animateIn() {
    this.timeline.from(
      this.el.nativeElement,
      this.duration,
      {
        opacity: "0",
        ease: "Expo.easeInOut"
      },
      this.delay
    );
    super.animateIn();
  }
}

import {
  Directive,
  ElementRef,
  EmbeddedViewRef,
  Input,
  TemplateRef,
  ViewContainerRef
} from "@angular/core";
import { CoreAnimationDirective } from "../gsap/core-animation.directive";

/**
 * This directive will show and hide an embedded viewRef using an @Input parameter called ngIfAnimated.
 * If passed show boolean is true, then it will create and embeddedView,
 * else it will dispatch a CustomEvent on the first rootNode,
 * passing the viewContainer reference.
 *
 */
@Directive({
  selector: "[NgIfAnimated]"
})
export class NgifAnimatedDirective{
  childViewRef: EmbeddedViewRef<CoreAnimationDirective>|null = null;

  constructor(
    private el: ElementRef,
    private templateRef: TemplateRef<any>,
    private viewContainer: ViewContainerRef
  ) {
  }

  @Input()
  set ngIfAnimated(show: boolean){
    if(show){
      this.childViewRef = this.viewContainer.createEmbeddedView(this.templateRef);
    }else{
      if(this.childViewRef){
        const node = this.childViewRef.rootNodes[0];
        if(node){
          node.dispatchEvent(new CustomEvent(
            'animate-out',
            {
              detail: {
                parentViewRef: this.viewContainer
              }
            }
          ));
        }
      }
    }
  }
}

